def get_input():
    n = int(input())
    promocodes = []
    for i in range(n):
        promocode = input()
        promocodes.append(promocode)
    return promocodes


def get_max_k(promocodes):
    max_k = 0
    for promocode in promocodes:
        k = 0
        for i in range(len(promocode)):
            for j in range(i + 1, len(promocode)):
                if promocode[i] != promocode[j]:
                    k += 1
        if k > max_k:
            max_k = k
    return max_k


def main():
    promocodes = get_input()
    max_k = get_max_k(promocodes)
    print(max_k)


